import { useEffect, useState } from "react"


function Grades(){
    const [grades,setGrades]= useState()
    useEffect(()=>{
        const res = fetch("http://localhost:8000/gradesof/"+localStorage.getItem("UTIS"))
        if(res.ok){
            setGrades(res.json())
        }
    },[])
    return <>{grades}</>

}

export default Grades
